#!/usr/bin/env node

const fs = require("fs")
const path = require("path")

const folderNames = ['./scripts','./components','./components/styles','./public','./public/styles','./assets'];


for(i=0;i<folderNames.length;i++){
    try {
    const folderName = folderNames[i]
    if (!fs.existsSync(folderName)) {
      fs.mkdirSync(folderName);
    }
  } catch (err) {
    console.error(err);
  }
}


